import React, { useMemo, useState } from 'react';
import * as ReactDOMClient from 'react-dom/client';
import './index.css';
import Principal from './Principal.js';
// import { checkCache } from './CacheContent.js';
import { BarraSuperior } from './components/BarraSuperior.js';

const TotalAmmountContext = React.createContext({
  carterTotalAmmount: '',
  setTotalAmmount: () => { },
});

const useTotalAmountProvider = () => {
  const [carterTotalAmmount, setTotalAmmount] = useState(0);
  const utilitiesSet = useMemo(
    () => ({ carterTotalAmmount, setTotalAmmount }),
    [carterTotalAmmount]
  );
  return utilitiesSet;
}
function renderizador() {
  // const utilitiesSet = useTotalAmountProvider()
  const utilitiesSet = useTotalAmountProvider();
  try {
    // checkCache();
    const contenedor = document.getElementById('root');
    const root = ReactDOMClient.createRoot(contenedor);
    root.render(
      <React.StrictMode>
        <TotalAmmountContext.Provider
          value={utilitiesSet}>
          <BarraSuperior />
          <Principal />
        </TotalAmmountContext.Provider>
      </React.StrictMode>
    );
  } catch (e) {
    console.log(e);
  }
}

renderizador();
